 @queuedjar4578  This is all very well said. Well done my friend. 

I personally have mixed feelings about emplemon's doc. It helped get a lot of people into the melee scene which I appreciate but I also feel like it gave those people a lot of misinformation or just gave them a somewhat negative view of the community. I really don't have anything against hbox but I find it kinda hard to support him just cuz most of his fanbase now is filled with people who try to act like they know a lot about melee when they don't really. Obviously it's fine for him to have more casual fans but I feel like those fans often claim false information about melee. Like I remember watching Armada's reaction of the emplemon doc. (Which I'm pretty sure isn't on his channel now due to the negative feedback he got for it) He was pretty critical of the doc overall and a lot of people in the comments were hating on Armada cuz they thought his criticism was just because of his hatred for puff or perceived hatred for Hbox when in reality the criticisms he made were valid.

I guess I don't have anything I'm trying to prove with this comment. Just wanted to share my thoughts.
